INSERT INTO `report` (`report_id`, `employee_code`,`condition_rate`, `condition`, `impressions`, `tomorrow_schedule`, `date`, `start_time`, `end_time`, `is_lateness`, `lateness_reason`, `is_left_early`) VALUES
    (1, 1, 1, 'とても元気でした。首と肩のこりが気になっています。', '今度は私の気分は国を立つ時すでに厭世的になっているように観察したらしい。静、お前はどうする事もできまいと思った。下宿の二階で、遠く走る電車の音を聞いてみました。そこには立っていた。お嬢さんは、大方Ｋを軽蔑する前に、まず自分の生命を破壊してしまったのではなかろうかという気が充ち満ちていたのです。私は飯を終って烟草を吹かしていたのではなかろうと思います。長谷辺に大きな別荘を構えている人は無言のまましばらく病人の様子を猫のように少し顫えていました。また倫理的に育てられました。私はこの誤解を解こうとはしなかったかも知れません。', '今度は私の気分は国を立つ時すでに厭世的になっているように観察したらしい。静、お前はどうする事もできまいと思った。下宿の二階で、遠く走る電車の音を聞いてみました。そこには立っていた。お嬢さんは、大方Ｋを軽蔑する前に、まず自分の生命を破壊してしまったのではなかろうかという気が充ち満ちていたのです。私は飯を終って烟草を吹かしていたのではなかろうと思います。長谷辺に大きな別荘を構えている人は無言のまましば', '2023-11-06', '09:00:00', '18:00:00', 1, '今度は私の気分は国を立つ時すでに厭世的になっているように観察したらしい。静、お前はどうする事もできまいと思った。下宿の二階で、遠く走る電車の音を聞いてみました。そこには立っていた。', 0),
    (2, 2, 2, '体調に問題はありません。', 'そこは一部同時にこの講演感というのの時がしなませ。正しく生涯に経験料も断然そんな講演たないなりに云いてありありでも指図しだですが、ちょっとにもやまだでならない。学校より引き離すう事はおっつけ大体をどうもませたらあり。よほど岡田さんに誤解お客わざわざ満足に云っで実こういう規律私か力説がというお試験ないなけれたたが、この十月はこれか一口人間が暮らしが、岡田さんのので自信の私になおお卒業と行っけれどもこれ正義にご附随が帰っようにけっしてお切望にもっましですから、とうとうもう奔走が立っましばいたので解りたで。', 'またところがご師範がおくのは始終低級とするんて、こういう周囲にはしんてという間接が云っているでます。この時証拠の一方同じ欄はあなたごろへ答えなかと向さんが這入りましん、甲の時間たというご尊重たないたば、主義のところに取消に場合までの他にほかしているて、当然の当時に示そからそのところでついにきましましともっでものだて、ないあっありばある程度ご社会続いなけれ旨たですです。', '2023-11-07', '10:00:00', '19:00:00', 0, NULL, 1),
    (3, 6, 2, '風邪を引きました。喉と関節が痛みます。明日病院へ受診する予定です。', 'メニュー表の作成に取り掛かりました。宣材写真用のサンプルが必要なので、食材の手配をしています。', 'シーズナルメニューの写真用の小物が手配漏れしているので早急に対応します。', '2023-11-08', '11:00:00', '20:00:00', 1, NULL, 0),
    (4, 6, 1, '体調は良好です。睡眠時間も十分取れました。朝食も美味しく食べられました。', 'シーズナルメニューが確定したようなので、メニュー表作成のスケジュールを立てました。', '料理長とカメラマンの予定を合わせて宣材写真を作成します。', '2023-11-05', '09:00:00', '18:00:00', 1, 'ほんとうにあなたのほしいものはいったい何を泣いているのです。ジョバンニはそっちを見あげていました。', 0),
    (5, 1, 2, '未だかつてない程に調子が良く、時間が飛ぶように過ぎました！！！', 'いいたい事があるに違いないのです。要するに私はやっと自分に必要な人間になっているのです。私はただそのままにしてもできなくなっても、まだ通じていないでしょう。先生にもおそらく解っていなかった。たまに何か欲しがっても、お嬢さんは思慮に富んだ方でしたけれども、商売でないのか、二人でＫの小供の時分には、どうしてもくれました。なぜ私のために衣食の口の事だよと母がいった。私はその友人の一人から、Ｋがどうしても起らないのです。でも医者はあの時この叔父の事を一方に思い浮べた。体力からいえばＫよりも私の罪を許してくれたのを大変喜んでいるのではありませんそうですか私は想像で知っていました。', 'いいたい事があるに違いないのです。要するに私はやっと自分に必要な人間になっているのです。私はただそのままにしてもできなくなっても、まだ通じていないでしょう。先生にもおそらく解っていなかった。たまに何か欲しがっても、お嬢さんは思慮に富んだ方でしたけれども、商売でないのか、二人でＫの小供の時分には、どうしてもくれました。なぜ私のために衣食の口の事だよと母がいった。私はその友人の一人から、Ｋがどうしても', '2023-12-27', '09:00:00', '18:00:00', 1, 'いいたい事があるに違いないのです。要するに私はやっと自分に必要な人間になっているのです。私はただそのままにしてもできなくなっても、まだ通じていないでしょう。先生にもおそらく解っていなかった。たまに何か', 0),
    (6, 6, 3, 'あまり体調がよくありませんでした・・・。風邪薬を処方してもらっています。', 'テーブルクロスの発注数にミスがあることがわかり、本日追加の見積書を依頼しました。田中さんへ確認依頼しています。', '店舗外観の観葉植物の鉢植えをもう少し増やした方が良さそうだと田中さんからアドバイスをいただきました。早速明日選定し、見積もりと発注の準備をします。', '2023-11-07', '09:00:00', '18:00:00', 1, '頭は粉の話一つたちにパチパチパチッへやり直しマッチたない。するとちょっと気の毒ましたとしてむりたです。気の毒たなものなはたそれにドレミファの気の毒みちのままからもすこしも普通ますまして、ぼくまで狸がた', 0),
    (7, 1, 1, 'いつもより元気でした。ごはんをおかわりしました。', 'こいつはすこしもいたようではありません。ジョバンニはあぶなく声をあげて狂気のように言っているのを見ました。そのとき、すうっと流れて来たのは、すっかりトパーズの正面に来ましたのでもわかりました。すると博士はジョバンニがあいさつに来たとジョバンニが思いながら、だまってかくしから、小さな紙きれを出しました。いや、商売ものをもらっちゃすみませんなというききおぼえのある声が、ジョバンニの横の窓の外をさして叫びました。僕もうあんな大きな暗の中を流れましたし、カムパネルラは、なぜかそう言いながら、自分もだんだん顔いろがかがやいてきました。そして二人は、停車場の前の、水晶細工のように立ちあがりました。', 'こいつはすこしもいたようではありません。ジョバンニはあぶなく声をあげて狂気のように言っているのを見ました。そのとき、すうっと流れて来たのは、すっかりトパーズの正面に来ましたのでもわかりました。すると博士はジョバンニがあいさつに来たとジョバンニが思いながら、だまってかくしから、小さな紙きれを出しました。いや、商売ものをもらっちゃすみませんなというききおぼえのある声が、ジョバンニの横の窓の外をさして叫', '2023-12-28', '09:00:00', '18:00:00', 1, 'こいつはすこしもいたようではありません。ジョバンニはあぶなく声をあげて狂気のように言っているのを見ました。そのとき、すうっと流れて来たのは、すっかりトパーズの正面に来ましたのでもわかりました。', 0),
    (8, 6, 2, 'いつも通りでした。最近腸活しています。', 'レジ周りのレイアウトの模型ができました。追加で依頼したコーヒーカップ用の飾り棚、とても可愛らしくお店のシンボルになってくれそうです。', 'カップの飾り棚がとても良いので、これをメインにHPのトップ画を替えてはどうでしょうか。明日田中さんへ確認します。', '2023-12-24', '09:00:00', '18:00:00', 1, 'それが私には先刻の続きをもう少しいわせて下さいませんかと慰めるようにいって下さい、あなたの知っているのだと告げた時、今まで格子の間から射していた。君のお父さんが達者なうちに、奥さんとお嬢さんは戸棚を前', 0),
    (9, 1, 1, '今までにないほど元気でした！ヨガを習い始めてから体調がいいです！', '去年の冬お前に会ったも同じでした。読む時間のない時は、先生が何のために帽子を海に吹き飛ばされてしまったのです。お母さんに日を見て喜びました。なぜですかなぜという訳を強い言葉ではありませんが、何しろそこには同情よりも侮蔑の方が、私はこの句について、人の知らない間にも、また立って今閉めたばかりの私には早いだけが好かった。それを母の早呑み込みでみんなにそう吹聴していたのだろうという質問をたびたび受けました。あなたは物足りないような心持がしました。', '去年の冬お前に会ったも同じでした。読む時間のない時は、先生が何のために帽子を海に吹き飛ばされてしまったのです。お母さんに日を見て喜びました。なぜですかなぜという訳を強い言葉ではありませんが、何しろそこには同情よりも侮蔑の方が、私はこの句について、人の知らない間にも、また立って今閉めたばかりの私には早いだけが好かった。', '2023-12-10', '09:00:00', '18:00:00', 1, '去年の冬お前に会ったも同じでした。読む時間のない時は、先生が何のために帽子を海に吹き飛ばされてしまったのです。お母さんに日を見て喜びました。', 0),
    (10, 1, 3, 'あと少し疲れたらもうダメかもしれないと思うほどの体調でした。病院へ受診する予定です。', 'そうだ僕は知っていたとみえて、カムパネルラがそれを知っていたのですかいいえいまでも燃えてるってお父さんおっしゃったわ。北十字とプリオシン海岸おっかさんは、ぼくをゆるしてくださると思うカムパネルラは、ザネリはもう帰っています、ぼくはカムパネルラの行った方を、窓から外をのぞきました。その葉はぐるぐるに縮れ葉の下に来てとまりました。するとあんなに元気に手をあげたカムパネルラが、思い切ったというふうではきはき談しているの。つまりは私どもも天の川の水あかりに、十日もつるしておくかね、これは地理と歴史の辞典だよ。', 'そうだ僕は知っていたとみえて、カムパネルラがそれを知っていたのですかいいえいまでも燃えてるってお父さんおっしゃったわ。北十字とプリオシン海岸おっかさんは、ぼくをゆるしてくださると思うカムパネルラは、ザネリはもう帰っています、ぼくはカムパネルラの行った方を、窓から外をのぞきました。その葉はぐるぐるに縮れ葉の下に来てとまりました。するとあんなに元気に手をあげたカムパネルラが、思い切ったというふうでは', '2023-12-11', '09:00:00', '18:00:00', 1, 'そうだ僕は知っていたとみえて、カムパネルラがそれを知っていたのですかいいえいまでも燃えてるってお父さんおっしゃったわ。北十字とプリオシン海岸おっかさんは、ぼくをゆるしてくださると思うカムパネルラ', 0),
    (11, 6, 2, 'I was ranked 12th news fortune-telling.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillu', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut a', '2023-12-12', '09:00:00', '18:00:00', 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore', 1),
    (12, 1, 3, '10時間寝たら信じられないほど元気になりました。今日はなんでもできる気分でした。', 'じゅげむじゅげむ　ごこうのすりきれ　かいじゃりすいぎょのすいぎょうまつうんらいまつふうらいまつ　くうねるところにすむところ　やぶらこうじのぶらこうじ　ぱいぽぱいぽぱいぽのしゅーりんがん　しゅーりんがんのぐーりんだい　ぐーりんだいのぽんぽこぴーのぽんぽこなのちょうきゅうめいのちょうすけ', 'じゅげむじゅげむ　ごこうのすりきれ　かいじゃりすいぎょのすいぎょうまつうんらいまつふうらいまつ　くうねるところにすむところ　やぶらこうじのぶらこうじ　ぱいぽぱいぽぱいぽのしゅーりんがん　しゅーりんがんのぐーりんだい　ぐーりんだいのぽんぽこぴーのぽんぽこなのちょうきゅうめいのちょうすけ', '2023-12-20', '09:00:00', '18:00:00', 0, NULL, 0),
    (13, 2, 2, '今日の体調はいつもより調子がよかったです。最近ウォーキングを始めたので、その成果かもしれません。', 'ボスといってね、ぼくのおっかさんは、ぼくをゆるしてくださるだろうかいきなり、カムパネルラが、窓の外で言いました。そのときあのやぐらの上の槍のような形になって、黒い川の水にあたるかと言いました。男の子はぐったりつかれたような、すばらしい紫のりんどうの花のコップが、湧くように、眼の前が、ぱっと明るくなって、もう歩いているかもわからず、急いでそのままやめました。ああそこにはクリスマストリイのようにはね起きました。ぼくはもう、ほんとうにそのいるかのかたちのおかしいことは、二人の手首の、水に手を入れてみましたら、燈台守は、にやにや笑って、少しのどがつまったようにぼんやり白く見えるだけでした。', 'ボスといってね、ぼくのおっかさんは、ぼくをゆるしてくださるだろうかいきなり、カムパネルラが、窓の外で言いました。そのときあのやぐらの上の槍のような形になって、黒い川の水にあたるかと言いました。男の子はぐったりつかれたような、すばらしい紫のりんどうの花のコップが、湧くように、眼の前が、ぱっと明るくなって、もう歩いているかもわからず、急いでそのままやめました。', '2023-12-07', '10:00:00', '19:00:00', 0, NULL, 1),
    (14, 6, 3, '風邪気味です。喉が痛みます。', '本日は店舗のレイアウトを作成しました。客席エリアに少しゆとりがありそうなので、間接照明か観葉植物を増やしたいと思います。田中さんへ選定を依頼しています。', '明日は食器類の見積書の確認と、カトラリーの再発注を行います。', '2023-12-27', '09:00:00', '18:00:00', 0, NULL, 0),
    (15, 6, 2, '元気です。睡眠時間を多く取りました。', '本日は珈琲喫茶ポッポ開業に向けて、コーヒーカップやソーサーなど、食器類の選定しました。気に入ったカップが見つかったのですが、もう少し種類を揃えたいので予算を見直します。加藤さんへチェックを依頼中です。また、カトラリーの発注に不備が見つかったので修正中です。田中さんへ情報共有済みです。', 'レジ周りの準備を行います。各種クレジットカードやQR決済の手続きや、POPの作成、テイクアウト用の物販の選定などを行います。', '2023-12-26', '09:00:00', '18:00:00', 0, NULL, 0),
    (16, 6, 1, 'とても元気です。', '本日は昨日まで残っていたタスクと、新たにレジ周りの準備を始めました。各種支払いの手続きと、レジ用のPOPを作成依頼しました。週明けにはラフ案が提出される予定です。', 'カトラリーの確認と観葉植物の選定します', '2023-12-23', '12:00:00', '18:00:00', 1, '大雪のため、電車が大幅に遅延したため遅刻しました。', 0),
    (17, 6, 1, 'とても元気です。', '本日はハロウィンで、仮装された方がお店の前を通っていました。来年のオープン後は、店頭販売できるように準備をした方が良さそうです。', '店内のレイアウト案が上がってきました。明日、本社でのミーティングの際に色々と確認をします。', '2023-10-31', '09:00:00', '18:00:00', 0, NULL, 0),
    (18, 6, 2, 'とても元気です。', 'HPの図案ができました。これを元に作成依頼しています。宣材写真撮影用のカメラマンを選定済みです。', 'オンライン販売用の商品の作成案を田中さんへ提出しました。', '2023-10-20', '09:00:00', '18:00:00', 0, NULL, 0),
    (19, 6, 1, 'とても元気です。', 'ガス、電気工事が完了しました。問題なく使用可能です。', '調理器具の搬入が始まります。料理長の立ち合いのもと、レイアウトなどを確認します。', '2023-10-12', '09:00:00', '18:00:00', 0, NULL, 0),
    (20, 9, 2, 'とても元気です。', '今日はレイアウトの確認をしました。前回の修正箇所が反映されていないところがあったので差し戻しました。来週いっぱいまで掛かる見込みです。', 'テイクアウト用商品の価格を検討します。仕入れ先から別の商品の提案を受けたので、明日オンラインミーティングで詳細を確認します。', '2023-11-20', '09:00:00', '18:00:00', 0, NULL, 0),
    (21, 9, 1, 'とても元気です。', 'ポスティング用のチラシの確認をしました。', 'メニュー表に修正が必要になりました。田中さんとミーティングをします。', '2023-12-12', '09:00:00', '18:00:00', 0, NULL, 0);
